import logo from './logo.jpeg';
import image from './flagAfrica.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={image} className="flagArica" alt="African continent containing African flags" />
        <img src={logo} className="App-logo" alt="logo" />

      </header>
    </div>
  );
}

export default App;
